// page init
jQuery(function(){
	initProductSlider();
	initTabsCaption();
	initShopLine();
	initBurger();
});

// init burger
function initBurger() {
	jQuery('.toggle-menu').on('click', function () {
		jQuery('.menu').toggleClass('open');
	});
}

// init tabs caption
function initTabsCaption() {
	jQuery('ul.tabs-caption').on('click', 'li:not(.active)', function() {
		jQuery(this)
			.addClass('active')
			.siblings()
			.removeClass('active')
			.closest('div.tabs')
			.find('div.tabs-content')
			.removeClass('active')
			.eq($(this)
				.index())
			.addClass('active');
	});
}

// init product slider
function initProductSlider() {
	jQuery('.product-slider').slick({
		dots: true,
		arrows: false,
		slidesToScroll: 2,
		slidesToShow: 4,
		responsive: [
			{
				breakpoint: 1201,
				settings: {
					slidesToShow: 3
				}
			},
			{
				breakpoint: 993,
				settings: {
					slidesToShow: 2
				}
			},
			{
				breakpoint: 577,
				settings: {
					slidesToScroll: 1,
					slidesToShow: 1
				}
			}
		]
	});
}

// init shop line
function initShopLine() {
	jQuery("#shop_line").mixItUp({
		selectors: {
			target: '.mix',
			filter: '.filter',
			sort: '.sort'
		},
		load: {
			filter: 'all',
			sort: 'myorder:asc'
		},
		controls: {
			enable: true,
		},
		animation: {
			enable: true,
			effects: 'scale fade',
			duration: 200
		}
	});
}

